import './App.css';
import MainPage from './pages/MainPage/MainPage';

import ResultPage from './pages/ResultPage/ResultPage';
import { Routes,Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
        <Routes>
          <Route path/>
        </Routes>
      <ResultPage />
    </div>
  );
}

export default App;
